import Link from "next/link";

const BlockLink = ({ props, title, link }) => (
  <Link href={`/${link}?id=${props.id}`} as={`/${link}/${props.id}`}>
    <a>
      <div className="block-option">
        <h2>{title}</h2>
      </div>
    </a>
  </Link>
);

const MenuBlock = ({ title, link }) => {
  return <BlockLink title={title} link={link} id="obywatele-państw-trzecich" />;
};

export default MenuBlock;
